u044f\u0432\u043b\u0435\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D0%B6%D0%B4%D1%83%D0%BD%D0%B0%D1%80%D0%BE%D0%B4%D0%BD%D1%8B%D0%B9_%D0%B6%D0%B5%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%B4%D0%B5%D0%BD%D1%8C\" title=\"\u041c\u0435\u0436\u0434\u0443\u043d\u0430\u0440\u043e\u0434\u043d\u044b\u0439 \u0436\u0435\u043d\u0441\u043a\u0438\u0439 \u0434\u0435\u043d\u044c\">\u041c\u0435\u0436\u0434\u0443\u043d\u0430\u0440\u043e\u0434\u043d\u044b\u043c \u0416\u0435\u043d\u0441\u043a\u0438\u043c \u0414\u043d\u0451\u043c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1910\" class=\"mw-redirect\" title=\"1910\">1910<\/a>&#160;\u2014 \u0412 \u0410\u043d\u0433\u043b\u0438\u0438 \u041a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u043a\u0438\u0439 \u0430\u044d\u0440\u043e\u043a\u043b\u0443\u0431 \u0432\u044b\u0434\u0430\u043b \u043f\u0435\u0440\u0432\u043e\u0435 \u0443\u0434\u043e\u0441\u0442\u043e\u0432\u0435\u0440\u0435\u043d\u0438\u0435 \u043f\u0438\u043b\u043e\u0442\u0430 \u0427\u0430\u0440\u043b\u044c\u0437\u0443 \u041c\u0443\u0440\u0443-\u0411\u0440\u0430\u0431\u0430\u0437\u043e\u043d\u0443, \u0430 \u0432\u043e \u0424\u0440\u0430\u043d\u0446\u0438\u0438 \u042d\u043b\u0438\u0437\u0430 \u0414\u0435\u0440\u043e\u0448 (\u0438\u043b\u0438 \u0434\u0435 \u041b\u044f\u0440\u043e\u0448) \u0441\u0442\u0430\u043b\u0430 \u043f\u0435\u0440\u0432\u043e\u0439 \u0436\u0435\u043d\u0449\u0438\u043d\u043e\u0439, \u0443\u0434\u043e\u0441\u0442\u043e\u0438\u0432\u0448\u0435\u0439\u0441\u044f \u043f\u043e\u0434\u043e\u0431\u043d\u043e\u0439 \u0447\u0435\u0441\u0442\u0438. \u0410\u043d\u0433\u043b\u0438\u0447\u0430\u043d\u0438\u043d \u043f\u043e\u0442\u043e\u043c \u0441\u0442\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BE%D1%80%D0%B4\" title=\"\u041b\u043e\u0440\u0434\">\u043b\u043e\u0440\u0434\u043e\u043c<\/a>, \u0430 \u0444\u0440\u0430\u043d\u0446\u0443\u0436\u0435\u043d\u043a\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D1%80%D0%BE%D0%BD\" title=\"\u0411\u0430\u0440\u043e\u043d\">\u0431\u0430\u0440\u043e\u043d\u0435\u0441\u0441\u043e\u0439<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1914\" class=\"mw-redirect\" title=\"1914\">1914<\/a>&#160;\u2014 \u0412\u044b\u0448\u0435\u043b \u0432 \u0441\u0432\u0435\u0442 \u043f\u0435\u0440\u0432\u044b\u0439 \u043d\u043e\u043c\u0435\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%96%D1%83%D1%80%D0%BD%D0%B0%D0%BB\" title=\"\u0416\u0443\u0440\u043d\u0430\u043b\">\u0436\u0443\u0440\u043d\u0430\u043b\u0430<\/a> \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B0%D0%B1%D0%BE%D1%82%D0%BD%D0%B8%D1%86%D0%B0_(%D0%B6%D1%83%D1%80%D0%BD%D0%B0%D0%BB)\" title=\"\u0420\u0430\u0431\u043e\u0442\u043d\u0438\u0446\u0430 (\u0436\u0443\u0440\u043d\u0430\u043b)\">\u0420\u0430\u0431\u043e\u0442\u043d\u0438\u0446\u0430<\/a>\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1917\" class=\"mw-redirect\" title=\"1917\">1917<\/a>&#160;\u2014 23 \u0444\u0435\u0432\u0440\u0430\u043b\u044f \u043f\u043e \u0441\u0442\u0430\u0440\u043e\u043c\u0443 \u0441\u0442\u0438\u043b\u044e \u0438\u043b\u0438 8 \u043c\u0430\u0440\u0442\u0430 \u043f\u043e \u043d\u043e\u0432\u043e\u043c\u0443 \u0441\u0442\u0438\u043b\u044e \u0432 \u041f\u0435\u0442\u0440\u043e\u0433\u0440\u0430\u0434\u0435 \u043f\u0440\u043e\u0448\u043b\u0438 \u0436\u0435\u043d\u0441\u043a\u0438\u0435 \u0434\u0435\u043c\u043e\u043d\u0441\u0442\u0440\u0430\u0446\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%83%D1%84%D1%80%D0%B0%D0%B6%D0%B8%D1%81%D1%82%D0%BA%D0%B8\" title=\"\u0421\u0443\u0444\u0440\u0430\u0436\u0438\u0441\u0442\u043a\u0438\">\u0441\u0443\u0444\u0440\u0430\u0436\u0438\u0441\u0442\u043e\u043a<\/a> \u0441 \u043b\u043e\u0437\u0443\u043d\u0433\u0430\u043c\u0438 \u00ab\u0425\u043b\u0435\u0431\u0430 \u0438 \u043c\u0438\u0440\u0430!\u00bb, \u043d\u0430 \u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0438\u0439 \u0434\u0435\u043d\u044c \u043a \u0437\u0430\u0431\u0430\u0441\u044